ication property = \"principal.<span style=\"color: rgb(221, 75, 57);\">username</span>\" /&gt;. &lt;/ security:authorize &gt;&nbsp;...</span></div></div></div></div><div class=\"g\" style=\"line-height: 1.2; font-size: small; margin-bottom: 26px;\"><div data-hveid=\"51\" data-ved=\"0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0QFQgzKAEwAQ\"><div class=\"rc\" style=\"position: relative;\"><h3 class=\"r\" style=\"font-size: 18px; font-weight: normal; line-height: 1.2; overflow: hidden; text-overflow: ellipsis; white-space: nowrap;\"><a href=\"https://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/&amp;ved=0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0QFgg0MAE\" target=\"_blank\" style=\"color: rgb(102, 0, 153); text-decoration-line: none;\">Get current logged in username in Spring Security - Mkyong</a></h3><div class=\"s\" style=\"max-width: 48em; color: rgb(60, 64, 67); line-height: 1.54;\"><div class=\"f kv _SWb\" style=\"height: 18px; line-height: 16px; white-space: nowrap;\"><cite class=\"_Rm\" style=\"color: rgb(0, 102, 33); font-style: normal; font-size: 14px;\">https://www.mkyong.com/.../get-current-logged-in-username-in-spring-secu...</cite><div class=\"action-menu ab_ctl\" style=\"display: inline; position: relative; margin-top: 1px; margin-right: 3px; margin-left: 3px; user-select: none; vertical-align: middle;\"><a class=\"_Fmb ab_button\" href=\"https://www.google.com/search?q=SecurityContextHolder%20username&amp;cad=h#\" id=\"am-b1\" aria-label=\"结果详情\" aria-expanded=\"false\" aria-haspopup=\"true\" role=\"button\" jsaction=\"m.tdd;keydown:m.hbke;keypress:m.mskpe\" data-ved=\"0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0Q7B0INTAB\" style=\"font-size: 11px; border-radius: 0px; cursor: default; font-weight: bold; height: 12px; line-height: 27px; margin-top: 1px; margin-bottom: 2px; min-width: 0px; text-align: center; transition: none; user-select: none; background-color: white; background-image: none; border: 0px; color: rgb(60, 64, 67); box-shadow: 0px 0px 0px 0px; filter: none; width: 13px; text-decoration-line: none; display: inline-block;\"><span class=\"mn-dwn-arw\" style=\"border-color: rgb(0, 102, 33) transparent; border-style: solid; border-width: 5px 4px 0px; width: 0px; height: 0px; margin-left: 3px; top: 7.2px; margin-top: -4px; position: absolute; left: 0px;\"></span></a><div class=\"action-menu-panel ab_dropdown\" role=\"menu\" tabindex=\"-1\" jsaction=\"keydown:m.hdke;mouseover:m.hdhne;mouseout:m.hdhue\" data-ved=\"0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0QqR8INjAB\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 1px solid rgba(0, 0, 0, 0.2); font-size: 13px; position: absolute; right: auto; top: 12px; z-index: 3; transition: opacity 0.218s; box-shadow: rgba(0, 0, 0, 0.2) 0px 2px 4px; left: 0px; visibility: hidden;\"><ol style=\"border: 0px;\"><li class=\"action-menu-item ab_dropdownitem\" role=\"menuitem\" style=\"border: 0px; list-style: none; user-select: none; cursor: pointer;\"><a class=\"fl\" href=\"https://webcache.googleusercontent.com/search?q=cache:-l7HFpZSFf8J:https://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/+&amp;cd=2&amp;hl=zh-CN&amp;ct=clnk&amp;gl=us\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://webcache.googleusercontent.com/search%3Fq%3Dcache:-l7HFpZSFf8J:https://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/%2B%26cd%3D2%26hl%3Dzh-CN%26ct%3Dclnk%26gl%3Dus&amp;ved=0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0QIAg3MAE\" target=\"_blank\" style=\"text-decoration-line: none; color: rgb(51, 51, 51); display: block; padding: 7px 18px; outline: 0px; font-size: 14px;\"></a></li><li class=\"action-menu-item ab_dropdownitem\" role=\"menuitem\" style=\"border: 0px; list-style: none; user-select: none; cursor: pointer;\"><a class=\"fl\" href=\"https://www.google.com/search?newwindow=1&amp;q=related:https://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/+SecurityContextHolder+username&amp;tbo=1&amp;sa=X&amp;ved=0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0QHwg4MAE\" style=\"text-decoration-line: none; color: rgb(51, 51, 51); display: block; padding: 7px 18px; outline: 0px; font-size: 14px;\"></a></li></ol></div></div><a class=\"fl\" href=\"https://translate.google.com/translate?hl=zh-CN&amp;sl=en&amp;u=https://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/&amp;prev=search\" ping=\"/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://translate.google.com/translate%3Fhl%3Dzh-CN%26sl%3Den%26u%3Dhttps://www.mkyong.com/spring-security/get-current-logged-in-username-in-spring-security/%26prev%3Dsearch&amp;ved=0ahUKEwiX3MWp-_7YAhXIWrwKHcYCBB0Q7gEIOjAB\" target=\"_blank\" style=\"text-decoration-line: none; color: rgb(25, 103, 210); font-size: 14px;\">翻译此页</a></div><span class=\"st\" style=\"line-height: 1.4; word-wrap: break-word;\"><span class=\"f\">2011年8月17日 -&nbsp;</span>RequestMethod; @Controller public class LoginController { @RequestMapping(<wbr>value=\"/login\", method = RequestMethod.GET) public String printUser(ModelMap model) { Authentication auth =&nbsp;<span style=\"color: rgb(221, 75, 57);\">SecurityContextHolder</span>.getContext().<wbr>getAuthentication(); String name = auth.getName(); //get logged in&nbsp;<span style=\"color: rgb(221, 75, 57);\">username</span>&nbsp;...</span></div></div></div></div></div></div></div></div></div></div></div></div></div></div>', '2018-01-30 13:47:29', '2018-01-30 13:47:29', 'wfwefewf', 1, 3);
INSERT INTO `article_article` VALUES (4, '<p style=\"text-align: center; margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64);\"><img src=\"http://127.0.0.1:9999/article/976e08fa-9387-4a42-9a44-1a2847c83e61.png\"><br></p><p style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify;\">我们必须承认，<a href=\"http://sports.163.com/keywords/6/8/6885897f/1.html\" title=\"梅西\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">梅西</a>在<a href=\"http://sports.163.com/keywords/8/7/897f7532/1.html\" title=\"西甲\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">西甲</a>生涯诺坎普200战中的表现不够出色。在阵地战中，梅西失去了射门精度，盲目盘带失误还直接导致<a href=\"http://sports.163.com/keywords/5/f/5df48428/1.html\" title=\"巴萨\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">巴萨</a>丢球。不过最终帮助巴萨逆转的，仍然是梅西。这一次，梅西利用任意球打进制胜球。</p><p class=\"f_center\" style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: center;\"><img alt=\"梅西超C罗成西甲任意球之王 圆月弯刀也是常规操作\" src=\"http://cms-bucket.nosdn.127.net/9611c743cd984531ae1065050c153ade20180129061709.jpeg?imageView&amp;thumbnail=550x0\" style=\"vertical-align: top; border: 0px; margin-right: auto; margin-left: auto; display: block;\"><br></p><p style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify;\">在上半场终盘阶段，梅西曾经踢过一次高质量的任意球。在右侧禁区前，梅西左脚任意球射门。<a href=\"http://sports.163.com/keywords/7/a/76ae7403/1.html\" title=\"皮球\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">皮球</a>在绕过人墙后快速下坠，并且带有强烈的侧旋。客队门将<a href=\"http://sports.163.com/keywords/5/1/5e15520779d1/1.html\" title=\"帕切科\" target=\"_blank\" style=\"color: rgb(15, 107, 153);\">帕切科</a>全力飞身扑救，他用指尖触碰到了皮球，皮球最终在击中右侧门柱后弹出底线。在21轮西甲联赛中，这是梅西第13次射中门框。</p><p style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify;\">在这次任意球攻防中，梅西输给了帕切科。不服输的梅西，在下半场终盘阶段又来了个几乎相同的任意球射门。几乎相同的射门位置，几乎相同的射门脚法，几乎相同的射门角度。这一次，帕切科仍然用指尖触碰到了皮球，但没有门柱来帮忙了。帕切科虽然碰到了球，但皮球仍然飞入了网窝之中。</p><p class=\"f_center\" style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: center;\"><img alt=\"梅西超C罗成西甲任意球之王 圆月弯刀也是常规操作\" src=\"http://cms-bucket.nosdn.127.net/e0b017ca744345f6800584e2bd1262e820180129061731.gif\" style=\"vertical-align: top; border: 0px; margin-right: auto; margin-left: auto; display: block;\"><br></p><p style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify;\"></p><p style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify;\">这个进球，是梅西半个月来打进的第二个精彩任意球。在1月中旬，巴萨客场4比2逆转<a href=\"http://goal.sports.163.com/23/team/188.html\" style=\"color: rgb(15, 107, 153);\">皇家社会</a>，梅西就曾打进了一个极为漂亮的落叶球。梅西主罚的任意球直挂球门左上死角，阿根廷国门鲁利完全没有做出扑救动作来。今夜，梅西又靠这个任意球帮助巴萨逆转获胜。</p><p style=\"margin-top: 28px; margin-bottom: 0px; font-size: 16px; text-indent: 2em; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; font-family: &quot;Microsoft Yahei&quot;; color: rgb(64, 64, 64); text-align: justify;\"><b>在梅西的西甲生涯中，这是他踢进的第21个任意球，他是西甲最近25年中的任意球之王。</b>C罗在西甲打进了20个任意球，梅西又在这项他原本大幅度落后的数据上逆转了葡萄牙人。比进球、比助攻、比突破、比输送威胁球，C罗原本就不是梅西的对手，如今他又在任意球上被梅西超越。C罗领先梅西的，也许也仅有点球了。在对阵瓦伦点球双响炮之后，C罗以72次主罚点球成为西甲历史12码之王。</p>', '2018-01-30 13:48:31', '2018-01-30 14:56:06', '梅西超C罗成西甲任意球之王 圆月弯刀也是常规操作', 1, 3);
